import React from 'react'
import { isPropertySignature } from 'typescript';

const ToDoItems =(props)=> {
  return (
    <div>
        <li onC style={{textDecoration:'line-through'}}>{props.text}</li>
    </div>
  )
}

export default ToDoItems;
